factions["Lizard"] = {{distance=6.86429948159252, heading=0.00332104868471319, own_y=1.66083562374115, json=[[{"Name": "Custom_Tile","Transform": {"posX": 50.0227737,"posY": 1.66083562,"posZ": 50.2642746,"rotX": 0.007125806,"rotY": 0.0484770425,"rotZ": 0.0782353058,"scaleX": 9.107194,"scaleY": 1.0,"scaleZ": 9.107194},"Nickname": "","Description": "","ColorDiffuse": {"r": 0.905,"g": 0.898,"b": 0.171999156},"Locked": true,"Grid": true,"Snap": true,"IgnoreFoW": false,"Autoraise": true,"Sticky": false,"Tooltip": true,"GridProjection": false,"HideWhenFaceDown": false,"Hands": false,"CustomImage": {"ImageURL": "http://cloud-3.steamusercontent.com/ugc/939465706361925031/EA86B4A9C4D768A70D4B9251BEA11993F57C85EE/","ImageSecondaryURL": "http://cloud-3.steamusercontent.com/ugc/939446378119266326/7989F7C85EADCB8E932A543F0A037BD06D21E90D/","WidthScale": 0.0,"CustomTile": {"Type": 0,"Thickness": 0.1,"Stackable": false,"Stretch": true}},"XmlUI": "","LuaScript": "mice = 0\r\nbunnies = 0\r\nfoxes = 0\r\nwait_id = 0\r\n\r\nfunction onLoad(save_state)\r\n    wait_id = Wait.time(updateButtons, 1, -1)\r\nend\r\n\r\nfunction onDestroy()\r\n    Wait.stop(wait_id)\r\nend\r\n\r\nfunction nothing()\r\nend\r\n\r\nfunction addCard(obj)\r\n    suit = obj.name:lower()\r\n    if suit == \"fox\" then\r\n        foxes = foxes +1\r\n    elseif suit == \"mouse\" then\r\n        mice = mice + 1\r\n    elseif suit == \"bunny\" then\r\n        bunnies= bunnies + 1\r\n    end\r\nend\r\n\r\nfunction updateButtons()\r\n    mice = 0\r\n    foxes = 0\r\n    bunnies = 0\r\n    self.clearButtons()\r\n    items = Physics.cast({\r\n        origin       = self.positionToWorld({-0.90, 0.2, 0.55}),\r\n        direction    = self.getTransformUp(),\r\n        type         = 3,\r\n        size         = {3, 0.1, 6},\r\n        max_distance = 2,\r\n    })\r\n    for _, item in ipairs(items) do\r\n        if item.hit_object.tag == \"Card\" then\r\n            addCard(item.hit_object)\r\n        end\r\n        if item.hit_object.tag == \"Deck\" then\r\n            for _, card in ipairs(item.hit_object.getObjects()) do\r\n                addCard(card)\r\n            end\r\n        end\r\n    end\r\n\r\n    self.createButton({\r\n        click_function = \"nothing\",\r\n        function_owner = self,\r\n        label = tostring(mice),\r\n        position = {0.7, 0.1, -0.17},\r\n        scale = {0.5, 0.5, 0.5},\r\n        width = 0,\r\n        height = 0,\r\n        font_size = 120\r\n    })\r\n    self.createButton({\r\n        click_function = \"nothing\",\r\n        function_owner = self,\r\n        label = tostring(bunnies),\r\n        position = {0.9, 0.1, -0.17},\r\n        scale = {0.5, 0.5, 0.5},\r\n        width = 0,\r\n        height = 0,\r\n        font_size = 120\r\n    })\r\n    self.createButton({\r\n        click_function = \"nothing\",\r\n        function_owner = self,\r\n        label = tostring(foxes),\r\n        position = {1.09, 0.1, -0.17},\r\n        scale = {0.5, 0.5, 0.5},\r\n        width = 0,\r\n        height = 0,\r\n        font_size = 120\r\n    })\r\nend","LuaScriptState": "","GUID": "6a1fe4","AttachedSnapPoints": [{"Position": {"x": -0.6259084,"y": 0.100000218,"z": -0.632033467},"Rotation": {"x": 5.99158739E-05,"y": 0.0142067941,"z": 4.573914E-05}},{"Position": {"x": -0.769556463,"y": 0.100000188,"z": -0.627778},"Rotation": {"x": 5.99158739E-05,"y": 0.0142067941,"z": 4.573914E-05}},{"Position": {"x": -0.9287303,"y": 0.100000158,"z": -0.6352461},"Rotation": {"x": 5.99158739E-05,"y": 0.0142067941,"z": 4.573914E-05}},{"Position": {"x": -1.08971775,"y": 0.100000158,"z": -0.628967345},"Rotation": {"x": 5.99158739E-05,"y": 0.0142067941,"z": 4.573914E-05}},{"Position": {"x": -0.705245,"y": 0.100001052,"z": -0.0574975833},"Rotation": {"x": -1.8441159E-06,"y": 359.989746,"z": 1.00292164E-06}},{"Position": {"x": -0.891449749,"y": 0.09999992,"z": -0.0575344637},"Rotation": {"x": 7.046069E-07,"y": 359.989777,"z": -2.59421336E-06}},{"Position": {"x": -1.09670246,"y":