  },
  "Nickname": "Weekly Croak Setup",
  "Description": "Setup (K)\n\nPlace each pawn in a clearing of ayour choice.",
  "ColorDiffuse": {
    "r": 0.545097947,
    "g": 0.5882353,
    "b": 0.4078426
  },
  "Locked": true,
