  },
  "Nickname": "Weekly Croak Law",
  "Description": "https://docs.google.com/document/d/1crplb1auWwzQrTX-AcfsbjKQPeMYVgNRjJONjUohWxw/edit?usp=sharing",
  "ColorDiffuse": {
